import {IoLogoFacebook, IoLogoGithub, IoLogoInstagram, IoLogoLinkedin} from "react-icons/io";
import {FaCodepen} from "react-icons/fa";
import "./Footer.scss";

const Footer = () => {
  return (
    <footer className="footer">
      <div className="externals">
        <h3>John Y.</h3>
        <ul>
          <li>
            <IoLogoFacebook />
          </li>
          <li>
            <IoLogoInstagram />
          </li>
          <li>
            <IoLogoLinkedin />
          </li>
          <li>
            <FaCodepen />
          </li>
        </ul>
      </div>
    </footer>
  );
};

export default Footer;
